import React, {useEffect, useState} from "react";

function NextPath({open, lpath}) {
    const [backend, setBackend] = useState([{}]);

    useEffect(() => {
        fetch(`path/${lpath}`).then(
          response => response.json()
        ).then(
          data => {
            setBackend(data)
            console.log(data)
          }
        )
      }, [])
}
export default NextPath;
